<script>
  const scripts = document.querySelectorAll(
    'script[type="text/javascript+gzip"]'
  );

    const xhr = new XMLHttpRequest();
    xhr.open("GET", script.src, false);
    xhr.onreadystatechange = () => {
      if (xhr.readyState !== XMLHttpRequest.DONE) return;
      if (xhr.status !== 200) {
        console.error("Could not load script", script.src);
      }
      const buffer = gunzipSync(new Uint8Array(JSON.parse(xhr.responseText)));
      const decoder = new TextDecoder();
      const contents = decoder.decode(buffer);
      const newScript = document.createElement("script");
      newScript.textContent = contents;
      script.parentNode.replaceChild(newScript, script);
    };
    xhr.send();
  }
</script> -->
